import React, { useEffect, useState } from 'react'
import { Container } from '@material-ui/core'
import axios from 'axios'

export default function Results() {
    const [data, setData] = useState([])
    useEffect(() => {
        let mounted = true
        axios
            .get(
                'http://164.90.163.136/app/search?searchquery=GME&startdate=2021-01-24%2002:33:15&enddate=2021-01-27%2002:33:15',
            )
            .then((res) => {
                if (mounted) {
                    let prefix = res.data.hits.hits._source
                    var arr = []
                    Object.keys(prefix).forEach(function (key) {
                        arr.push(prefix[key])
                    })
                    console.log('Home Data: ', arr)
                    setData(arr)
                }
            })
            .catch((err) => {
                console.log(err)
            })
    }, [])

    return (
        <main className="results">
            <Container>
                <h1>ToTheM00n Search Results 💎 👐 💎 👐 💎 👐 💎 👐💎</h1>
                {console.log(data)}
                {data.map((item, index) => (
                    <div>
                        <h5>{item.title}</h5>
                        <p>Date: {item.date}</p>
                        <p>Subreddit: {item.subreddit}</p>
                        <p>Number of Comments: {item.num_comments}</p>
                        <p>Number of Upvotes: {item.score}</p>
                        <p>url: {item.url}</p>
                        <p>{item.body}</p>
                    </div>
                ))}
            </Container>
        </main>
    )
}
